import React from 'react'

const Home = () => {
    return ( 
        <section className="home">
            <video className="" muted loop autoplay>
                <source src={ process.env.PUBLIC_URL + '/assets/homeVideo.mp4' }  type="video/mp4"/>
            </video>


        </section> 
    );
}
export default Home;
